import React from 'react';

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import './../style/ImageUpload.css';

export default () => {
    return (
        <Container>
            <Row>
                <div>Upload</div>
            </Row>
            <Row>
                <Col></Col>
                <Col></Col>
            </Row>
            <Row>
                <Col></Col>
                <Col></Col>
            </Row>
        </Container>
    );
};
